// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;
import "./dice.sol";

contract DiceMarket {
    mapping(uint256 => uint256) public idtoprice;
    
    Dice public diceContract;
    uint256 public commissionFee;
    address public thisaddress;
    
    event DiceListed(uint256 indexed diceId, uint256 price);
    event DiceUnlisted(uint256 indexed diceId);
    event DiceSold(uint256 indexed diceId, uint256 price);

    constructor(Dice _diceContract, uint256 _commissionFee) {
        diceContract = _diceContract;
        commissionFee = _commissionFee;
        thisaddress = address(this);
    }

    function list(uint256 _diceId, uint256 _price) public {
        // require price > dice_value + commission
        require(_price > diceContract.getDiceValue(_diceId) + commissionFee, "Price must be greater than dice value plus commission fee");
        // require owner of dice to be dice market
        require(diceContract.getOwner(_diceId) == address(this), "Owner of dice must be dice market");

        // Create a new market listing
        idtoprice[_diceId] = _price;

        emit DiceListed(_diceId, _price);
    }

    function unlist(uint256 _diceId) public {
        // require dice to be listed on market
        require(idtoprice[_diceId] > 0, "Dice must be listed on dice market to be unlisted");

        // delete listing
        delete idtoprice[_diceId];

        emit DiceUnlisted(_diceId);
    }

    function checkPrice(uint256 _diceId) public view returns (uint256) {
        // require dice to be listed on market
        require(idtoprice[_diceId] > 0, "Dice must be listed on dice market to be priced");

        return idtoprice[_diceId];
    }

    function buy(uint256 _diceId) public payable {
        uint256 price = idtoprice[_diceId];
        require(price > 0, "Dice must be listed on dice market to be sold");
        require(msg.value == price, "Price not correct");

        address seller = diceContract.getprevOwner(_diceId);
        require(seller != address(0), "Invalid owner");
        require(seller != msg.sender, "Cannot buy your own dice");
        require(seller != address(this), "Market cannot buy dice");

        payable(seller).transfer(price - commissionFee);
        diceContract.transfer(_diceId, msg.sender);

        emit DiceSold(_diceId, price);
    }

    
}
